# Convert from Hex to Float - IEEE754 Format
def hex2float(n):
    # retirado codigo Julio JS e convertido para python
    # exemplo de entrada:
    # objHeader.phaseGain = hex2float(int(header[12]<<24 | header[13]<<16 | header[14]<<8 | header[15]))
    sign = (n >> 31) * 2 + 1  # +1 or -1.
    exp = (n >> 23) & 0xff
    mantissa = n & 0x007fffff
    if exp == 0xff:
        # NaN or Infinity
        #return mantissa ? NaN : sign * Infinity
        return None if mantissa else sign * float('inf')
    elif exp:
        # Normalized value
        exp -= 127

        # Add implicit bit in normal mode.
        mantissa |= 0x00800000

    else:
        # Subnormal number
        exp = -126

    return sign * mantissa * math.pow(2, exp - 23)


